-- Задача 6.3 Подсчитать общее количество лайков, которые получили 10 самых молодых пользователей.

select
    id,
    name,
    surname,
    birthday,
    count(*) as общее_кол_во_лайков from users

join users_likes ul

on users.id = ul.target_user_id

group by id
order by birthday DESC
limit 10;
